import './ErrorBox.css';

const ErrorBox = (props) => {
	return (
		<div className='error__box'>
			<h1>Wpisałeś błędnie {props.value}</h1>
			<p>Sprawdź ponownie wypełnione przez Ciebie dane</p>
		</div>
	);
};

export default ErrorBox;
